import React from 'react';

function Food({ fav }) {
  return <h1>I like {fav}</h1>
}

const foodILike = [
  {
    name: "kimchi",
    image: ""
  },
  {
    name: "ramen",
    image: ""
  },
  {
    name: "samgiopsal",
    image: ""
  },
  {
    name: "chukumi",
    image: ""
  }
]

function App() {
  return (
    <div>
      {foodILike.map(dish => (<Food name={dish.name} /> ))}
    </div>
  );
}

export default App;
